import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
// import UButton from './utilities/UButton';
import Page from './utilities/Page';
import UTextInput from './UTextInput';
import USelectDropdown from './USelectDropdown';
import UButton from './utilities/UButton';

export default () => {
    return (
        <Page>
            <Row>
                <Col>
                    <Row>
                        <UTextInput placeholder='Model Name' label='Model Name'></UTextInput>
                    </Row>
                    <Row>
                        <USelectDropdown placeholder='Filament' options={['one', 'two', 'three']}></USelectDropdown>
                    </Row>
                    <Row>
                        <UButton onClick={() => {}} variant={'secondary'} size={'sm'}>
                            Select File
                        </UButton>
                    </Row>
                </Col>
                <Col></Col>
            </Row>
        </Page>
    );
};
